import BaseAxiosInstance from "libs/axios/BaseAxiosInstance";

const authServices = {
  signIn(formData) {
    return BaseAxiosInstance.post("api/auth/sign-in", formData);
  },
  signUp(formData) {
    return BaseAxiosInstance.post("auth/sign-up", formData);
  },
};

export default authServices;
